(20, 45, 19, 11, 38, 3, 'eksempeldata/joomla/utvidelser', 'com_content', 'Utvidelser', 'utvidelser', '', '<p>Joomla! publiseringsløsning lar deg lage nettsider av ulike typer ved bruk av utvidelser. Det er 5 grunnleggende type utvidelser: komponenter, moduler, maler, språk, og programtillegg. Din nettside inkluderer de utvidelsene du trenger for å skape en grunnleggende nettside. I tillegg finnes det tusenvis av ytterligere utvidelser av alle typer i <a href="http://extensions.joomla.org" target="_blank">Joomla! utvidelsesskatalogen</a></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 21:43:13', 0, '*'),
(21, 46, 20, 12, 13, 4, 'eksempeldata/joomla/utvidelser/komponenter', 'com_content', 'Komponenter', 'komponenter', '', '<p><img class="image-left" src="administrator/templates/bluestork/images/header/icon-48-component.png" border="0" alt="Komponentbilde" />Komponenter er det som ”produserer” det meste av innholdet på nettstedet ditt. Hver komponent har en eller flere "visninger" som styrer hvordan innholdet vises. I administrasjonen er det ytterligere utvidelser, som menyer, omadressering og administrasjon av utvidelsene.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 21:45:23', 0, '*'),
(22, 47, 20, 14, 25, 4, 'eksempeldata/joomla/utvidelser/moduler', 'com_content', 'Moduler', 'moduler', '', '<p><img class="image-left" src="administrator/templates/bluestork/images/header/icon-48-module.png" border="0" alt="Mediabilde" />Moduler er små blokker med innhold som kan vises i posisjoner på en nettside. Menyene på dette nettstedet er vist i moduler. Standard installasjon av Joomla! omfatter 17 separate moduler fra pålogging til søk til tilfeldige bilder. Hver modul har et navn som starter mod_ , men når de vises har de en tittel. I beskrivelsene i denne delen, er tittelen det samme som navnene.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 21:47:11', 0, '*'),
(23, 48, 20, 26, 33, 4, 'eksempeldata/joomla/utvidelser/maler', 'com_content', 'Maler', 'maler', '', '<p><img src="administrator/templates/bluestork/images/header/icon-48-themes.png" border="0" alt="Mediabilde" align="left" />Maler gir nettstedet ditt utseendet. De bestemmer utforming, farger, skriftstyper, grafikk og andre aspekter ved designet som gjør nettstedet ditt unikt. Standard installasjon av Joomla leveres ferdige med tre maler. <a href="http://help.joomla.org/proxy/index.php?option=com_help&keyref=Help16:Extensions_Template_Manager_Templates">Hjelp</a></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-15 22:29:24', 0, '*'),
(24, 49, 20, 34, 35, 4, 'eksempeldata/joomla/utvidelser/sprak', 'com_content', 'Språk', 'sprak', '', '<p><img src="administrator/templates/bluestork/images/header/icon-48-language.png" border="0" alt="Språkbildee" align="left" />Joomla! installerer på norsk, og som standard følger det også med engelsk tekst for grensesnittet, eksempeldataene og hjelp er tilgjengelig på mange språk. <a href="http://help.joomla.org/proxy/index.php?option=com_help&keyref=Help16:Extensions_Language_Manager_Installed">Hjelp</a></p>\r\n<p><a href="http://community.joomla.org/translations.html">Oversettelsesinformasjon</a></p>\r\n<p>Hvis det ikke er noen språkpakker tilgjengelig for ditt språk, finnes det instruksjoner for å lage din egen oversettelse, så kan du også bidra til fellesskapet ved å starte en godkjent oversettelsesgruppe.</p>\r\n<p>Oversettelser installeres ved hjelp av installasjonen på utvidelser i administratorområdet og administreres ved hjelp av språkbehandleren.</p>\r\n<p>Hvis to eller flere språk er installert kan du aktivere programtillegget og modul for språkbytting. De bør alltid brukes sammen. Hvis du oppretter flerspråklig innhold og merker innholdet, menyelementer eller moduler for bestemte språk og følger <a href="http://docs.joomla.org/Language_Switcher_Tutorial_for_Joomla_1.6">instruksjonene</a> vil brukerne kunne velge et bestemt innholdsspråk ved hjelp av modulen. Som standard er både programtillegget og modulen deaktivert.</p>\r\n<p>Det finnes en rekke tilgjengelige utvidelser som kan hjelpe deg å administrere oversettelser av innholdet<a href="http://extensions.joomla.org"> Joomla! utvidelsesbibliotek</a>.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-15 21:10:06', 0, '*'),
(25, 50, 20, 36, 37, 4, 'eksempeldata/joomla/utvidelser/programtillegg', 'com_content', 'Programtillegg', 'programtillegg', '', '<p><img src="administrator/templates/bluestork/images/header/icon-48-plugin.png" border="0" alt="Bilde programtillegg" align="left" />Programtillegg er utvidelser som utfører bestemte oppgaver som forbedrer Joomla! rammeverket. Noen er knyttet til spesielle utvidelser og andre, slik som tekstbehandleren, er brukt over hele Joomla! De fleste nybegynnere trenger ikke å endre noen av de programtilleggene som installerer med Joomla! <a href="http://help.joomla.org/proxy/index.php?option=com_help&keyref=Help16:Extensions_Plugin_Manager_Edit">Hjelp</a></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-15 21:10:31', 0, '*'),
(26, 51, 14, 40, 49, 2, 'eksempeldata/parker', 'com_content', 'Parker', 'parker', '', '', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 23:26:29', 0, 'nb-NO'),
(27, 52, 26, 41, 42, 3, 'eksempeldata/parker/parkblogg', 'com_content', 'Parkblogg', 'parkblogg', '', '<p><span style="font-size: 12px;">Her skal jeg skrive blogg om parkene i Australia.</span></p>\r\n<p><em>Du kan lage en blogg på nettstedet ditt ved å opprette en kategori for å skrive blogginnlegg på (denne kalles Parkblogg). Hver blogg vil være en artikkel i den kategorien. Hvis du oppretter en meny som kategoriblogg med 1 kolonne vil det se slik ut på siden, hvis du viser kategoribeskrivelsen (denne delen) vil den vises. </em></p>\r\n<p><em>For å forbedre bloggen din vil du kanskje legge til utvidelser for <a href="http://extensions.joomla.org/extensions/contacts-and-feedback/articles-comments" style="color: #1b57b1; text-decoration: none; font-weight: normal;">kommentarer</a>,<a href="http://extensions.joomla.org/extensions/social-web" style="color: #1b57b1; text-decoration: none; font-weight: normal;"> samspill med sosiale nettverk</a>, <a href="http://extensions.joomla.org/extensions/content-sharing" style="color: #1b57b1; text-decoration: none; font-weight: normal;">tagging</a>, og <a href="http://extensions.joomla.org/extensions/content-sharing" style="color: #1b57b1; text-decoration: none; font-weight: normal;">holde kontakt med leserne</a>. Du kan aktivere syndikering som er inkludert i Joomla! (på Integrasjon, Vis matingslenke settes til Vis og modulen for Syndikat må vises på siden).</em></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":"images\\/sampledata\\/parks\\/banner_cradle.jpg"}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-13 10:32:35', 0, 'nb-NO'),
(28, 53, 26, 43, 48, 3, 'eksempeldata/parker/bildegalleri', 'com_content', 'Bildegalleri', 'bildegalleri', '', '<p><img src="images/sampledata/parks/banner_cradle.jpg" border="0" /></p>\r\n<p>Dette er mine bilder fra parker jeg har besøkt (jeg har ikke tatt bildene selv, de er alle fra <a href="http://commons.wikimedia.org/wiki/Main_Page">Wikimedia Commons</a>).</p>\r\n<p><em>Dette viser hvordan du kan lage et enkelt bildegalleri med artikler i com_content. </em></p>\r\n<p><em>Bruk et miniatyrbilde i introteksten før ”Les mer” og bildet i full størrelse etter. Sett parametre Vis intortekst til Skjul. </em></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-13 21:13:38', 0, 'nb-NO'),
(29, 54, 14, 50, 55, 2, 'eksempeldata/fruktbutikker', 'com_content', 'Fruktbutikker', 'fruktbutikker', '', '', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 23:27:41', 0, '*'),
(30, 55, 29, 51, 52, 3, 'eksempeldata/fruktbutikker/gartnere', 'com_content', 'Gartnere', 'gartnere', '', '<p>Vi søker i hele landet etter de beste fruktdyrkerne.</p>\r\n<p><em>Du kan la hver leverandør ha sin egen side som de selv kan redigere. For å se dette i praksis må du opprette en bruke i gruppen leverandører.  <br />Opprett en side i kategorien Gartnere for brukeren og sett leverandøren som skribent av siden.  Denne brukeren kan da redigere sin egen side. </em></p>\r\n<p><em>Dette illustrerer bruk av rettigheten Rediger egne. </em></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-13 21:37:12', 0, '*'),
(31, 56, 18, 2, 3, 2, 'eksempeldata-nettlenker/parker', 'com_weblinks', 'Parker', 'parker', '', '<p>Her er lenker til noen av mine favorittparker.</p>\r\n<p><em>Nettlenkekomponenten inneholder en enkel måte å opprette lenker til eksterne nettsteder som er konsekvent formatert og kategorisert. Du kan også opprette lenker fra brukersiden av nettstedet.</em></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":"images\\/sampledata\\/parks\\/banner_cradle.jpg"}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-15 00:03:13', 0, 'nb-NO'),
(32, 57, 18, 4, 7, 2, 'eksempeldata-nettlenker/joomla', 'com_weblinks', 'Joomla!', 'joomla', '', '<p>Et utvalg av lenker relatert til Joomla! prosjekter.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-15 00:05:13', 0, '*'),
