(64, 93, 22, 15, 16, 5, 'eksempeldata/joomla/utvidelser/moduler/innholdsmoduler', 'com_content', 'Innholdsmoduler', 'innholdsmoduler', '', '<p>Innholdsmoduler viser artikler og annen informasjon fra innholdskomponenten.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 21:48:00', 0, '*'),
(65, 94, 22, 17, 18, 5, 'eksempeldata/joomla/utvidelser/moduler/brukermoduler', 'com_content', 'Brukermoduler', 'brukermoduler', '', '<p>Brukermoduler samhandler med brukersystemet, slik at brukere kan logge inn, viser hvem som er logget inn, og viser den sist registrerte bruker.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 21:49:01', 0, '*'),
(66, 95, 22, 19, 20, 5, 'eksempeldata/joomla/utvidelser/moduler/visningsmoduler', 'com_content', 'Visningsmoduler', 'visningsmoduler', '', '<p>Disse modulene vise informasjon fra andre komponenter enn innhold og brukere. Disse inkluderer nettlenker, nyhetsmatninger og mediabehandler.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 21:49:59', 0, '*'),
(67, 96, 22, 21, 22, 5, 'eksempeldata/joomla/utvidelser/moduler/nyttemoduler', 'com_content', 'Nyttemoduler', 'nyttemoduler', '', '<p>Nyttemoduler gir nyttig funksjonalitet som søk, syndikat, og statistikk.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 22:01:15', 0, '*'),
(68, 97, 23, 31, 32, 5, 'eksempeldata/joomla/utvidelser/maler/atomic', 'com_content', 'Atomic', 'atomic', '', '<p>Atomic er en enkel mal designet for å være et skjelett for å lage din egen mal, og å lære om maler i Joomla!</p>\r\n<p><img src="templates/atomic/template_thumbnail.png" border="0" alt="Atomic mal" style="border: 0; float: right;" /></p>\r\n<p> </p>\r\n<ul>\r\n<li><a href="index.php?Itemid=285">Startside</a></li>\r\n<li><a href="index.php?Itemid=316">Typografi</a></li>\r\n</ul>\r\n<p> </p>\r\n<p> </p>\r\n<p><br /><br /></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 22:39:45', 0, '*'),
(69, 98, 23, 27, 28, 5, 'eksempeldata/joomla/utvidelser/maler/beez-20', 'com_content', 'Beez 20', 'beez-20', '', '<p><img src="templates/beez_20/template_thumbnail.png" border="0" alt="Beez_20 miniatyrbilde" align="right" style="float: right; margin: 5px,80px,5px,25px;" /></p>\r\n<p>Beez 2.0 er en allsidig mal, lett å tilpasse, som fungerer for en rekke nettsteder. Den oppfyller viktige standarder for tilgjengelighet og viser et utvalg av css og javaskriptteknikker. Beez 2.0 er standard malen som installeres med Joomla!</p>\r\n<ul>\r\n<li><a href="index.php?Itemid=424">Startside</a></li>\r\n<li><a href="index.php?Itemid=423">Typografi</a></li>\r\n</ul>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 22:32:48', 0, '*'),
(70, 99, 23, 29, 30, 5, 'eksempeldata/joomla/utvidelser/maler/beez5', 'com_content', 'Beez5', 'beez5', '', '<p><img src="templates/beez5/template_thumbnail.png" border="0" alt="Beez5 Miniatyrbilde" align="right" style="float: right;" /></p>\r\n<p> </p>\r\n<p>Beez 5 er en HTML5 implementering av en Joomla! mal. Den bruker en rekke HTML5 teknikker for å forbedre presentasjonen av et nettsted. Den brukes som mal for eksempelsiden Fruktbutikker.</p>\r\n<ul>\r\n<li><a href="index.php?Itemid=458">Startside</a></li>\r\n<li><a href="index.php?Itemid=457">Typografi</a></li>\r\n</ul>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-12 22:36:36', 0, '*'),
(72, 108, 28, 44, 45, 4, 'eksempeldata/parker/bildegalleri/dyr', 'com_content', 'Dyr', 'dyr', '', '', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-13 21:14:03', 0, 'nb-NO'),
(73, 109, 28, 46, 47, 4, 'eksempeldata/parker/bildegalleri/steder', 'com_content', 'Steder', 'steder', '', '', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-15 22:49:50', 0, 'nb-NO'),
(75, 166, 22, 23, 24, 5, 'eksempeldata/joomla/utvidelser/moduler/navigasjonsmoduler', 'com_content', 'Navigasjonsmoduler', 'navigasjonsmoduler', '', '<p>Navigasjonsmoduler hjelper de besøkende å navigere seg gjennom nettstedet ditt og finne det de trenger.</p>\r\n<p>Menyer gir nettstedet struktur og hjelpe de besøkende å navigere på nettstedet. Selv om de alle er basert på samme menymodulen, viser menyen som brukes i eksempeldataene hvor fleksibel denne modulen er.</p>\r\n<p>En meny kan være alt fra svært enkle (for eksempel toppmenyen eller menyen om australske parker) til svært komplekse menyer (for eksempel menyen Om Joomla! med sine mange nivåer). De kan også brukes til andre typer presentasjoner som nettstedskartet lenket fra menyen "Denne siden".</p>\r\n<p>Brødsmuler gi brukerne informasjon om hvor de er på nettstedet.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-14 22:26:35', 0, '*'),
(76, 167, 29, 53, 54, 3, 'eksempeldata/fruktbutikker/oppskrifter', 'com_content', 'Oppskrifter', 'oppskrifter', '', '<p>Kunder og leverandører kan her legge inn sine egne fruktoppskrifter.</p>\r\n<p>En god idé er å bruke nøkkelord i metadata for å enkelt finne andre oppskrifter med de samme fruktene.</p>\r\n<p><em>For å se dette i praksis, opprett en bruker i gruppen Kunder og en bruker i gruppen Leverandører. Disse brukerne vil kunne opprette og redigere sine egen sider med oppskrifter. De vil ikke kunne redigere andre brukeres sider.</em><br /><br /></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2011-01-01 00:00:01', 44, '2011-01-13 21:50:14', 0, '*'),
(77, 169, 1, 133, 134, 1, 'ukategorisert', 'com_users.notes', 'Ukategorisert', 'ukategorisert', '', '', 1, 0, '0000-00-00 00:00:00', 1, '{"target":"","image":""}', '', '', '{"page_title":"","author":"","robots":""}', 42, '2012-01-29 19:21:58', 0, '0000-00-00 00:00:00', 0, '*');
