(5, 'Bananer', 'bananer', 'Vitenskapelig navn: Musa', 'Bilde: Enzik\r\nRettigheter: Creative Commons Share Alike 3.0 Unported\r\nKilde: http://commons.wikimedia.org/wiki/File:Bananas_-_Morocco.jpg', '', 'Type: Herbaceous', 'Store produsenter: India, Kina, Brasil', '', '', '', '<p>Bananer er en stor kilde til kalium.</p>', 'images/sampledata/fruitshop/bananas_2.jpg', NULL, '', 0, 1, 0, '0000-00-00 00:00:00', 1, '{"show_contact_category":"show_with_link","show_contact_list":"","presentation_style":"plain","show_name":"","show_position":"1","show_email":"","show_street_address":"","show_suburb":"","show_state":"1","show_postcode":"","show_country":"1","show_telephone":"","show_mobile":"","show_fax":"","show_webpage":"","show_misc":"","show_image":"","allow_vcard":"","show_articles":"","show_profile":"","show_links":"1","linka_name":"Wikipedia: Bananer Norsk","linka":"http:\\/\\/no.wikipedia.org\\/wiki\\/Bananer","linkb_name":"Wikipedia: Banana English","linkb":"http:\\/\\/en.wikipedia.org\\/wiki\\/Banana","linkc_name":"Wikipedia:Banana Portugu\\u00eas","linkc":"http:\\/\\/hi.wikipedia.org\\/wiki\\/%E0%A4%95%E0%A5%87%E0%A4%B2%E0%A4%BE","linkd_name":"Wikipedia: \\u0411\\u0430\\u043d\\u0430\\u043d  \\u0420\\u0443\\u0441\\u0441\\u043a\\u0438\\u0439","linkd":"http:\\/\\/ru.wikipedia.org\\/\\u0411\\u0430\\u043d\\u0430\\u043d","linke_name":"","linke":"","contact_layout":"beez5:encyclopedia","show_email_form":"","show_email_copy":"","banned_email":"","banned_subject":"","banned_text":"","validate_session":"","custom_reply":"","redirect":""}', 0, 39, 1, '', '', '', '', '', '*', '2011-01-01 00:00:01', 0, 'Foreningen Joomla! i Norge', '2011-01-15 22:57:26', 44, '', '', '{"robots":"","rights":""}', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(6, 'Epler', 'epler', 'Vitenskapelig navn: Malus domestica', 'Bilde: Fievet\r\nRettigheter: Public Domain\r\nKilde: http://commons.wikimedia.org/wiki/File:Pommes_vertes.JPG', '', 'Familie: Rosaceae', 'Store produsenter: Kina, USA', '', '', '', '<p>Epler er en allsidig frukt, som brukes for å spise, matlaging, og konservering.</p>\r\n<p>Det er dyrket flere enn 7500 forskjellige type epler over hele verden.</p>', 'images/sampledata/fruitshop/apple.jpg', NULL, '', 0, 1, 0, '0000-00-00 00:00:00', 1, '{"show_contact_category":"","show_contact_list":"","presentation_style":"plain","show_name":"","show_position":"","show_email":"","show_street_address":"","show_suburb":"","show_state":"","show_postcode":"","show_country":"","show_telephone":"","show_mobile":"","show_fax":"","show_webpage":"","show_misc":"","show_image":"","allow_vcard":"","show_articles":"","show_profile":"","show_links":"1","linka_name":"Wikipedia: Epler Norsk","linka":"http:\\/\\/no.wikipedia.org\\/wiki\\/Epleslekten","linkb_name":"Wikipedia: Apples English","linkb":"http:\\/\\/en.wikipedia.org\\/wiki\\/Apple","linkc_name":"Wikipedia: Manzana Espa\\u00f1ol ","linkc":"http:\\/\\/es.wikipedia.org\\/wiki\\/Manzana","linkd_name":"Wikipedia: \\u82f9\\u679c \\u4e2d\\u6587","linkd":"http:\\/\\/zh.wikipedia.org\\/zh\\/\\u82f9\\u679c","linke_name":"","linke":"","contact_layout":"beez5:encyclopedia","show_email_form":"","show_email_copy":"","banned_email":"","banned_subject":"","banned_text":"","validate_session":"","custom_reply":"","redirect":""}', 0, 42, 1, '', '', '', '', '', '*', '2011-01-01 00:00:01', 0, 'Foreningen Joomla! i Norge', '2011-01-15 22:59:13', 44, '', '', '{"robots":"","rights":""}', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(7, 'Tamarind', 'tamarind', 'Vitenskapelig navn: Tamarindus indica', 'Bilde: Franz Eugen Köhler, Köhler''s Medizinal-Pflanzen\r\nRettigheter: Public Domain\r\nKilde: http://commons.wikimedia.org/wiki/File:Koeh-134.jpg', '', 'Familie: Fabaceae', 'Store produsenter: India, USA', '', '', '', '<p>Tamarinds er en allsidig frukt som brukes rundt om i verden. Før den modnes helt kan den brukes i sterke sauser, som modnet frukt er den grunnlag for mange forfriskende drinker.</p>', 'images/sampledata/fruitshop/tamarind.jpg', NULL, '', 0, 1, 0, '0000-00-00 00:00:00', 1, '{"show_contact_category":"","show_contact_list":"","presentation_style":"plain","show_name":"","show_position":"","show_email":"","show_street_address":"","show_suburb":"","show_state":"","show_postcode":"","show_country":"","show_telephone":"","show_mobile":"","show_fax":"","show_webpage":"","show_misc":"","show_image":"","allow_vcard":"","show_articles":"","show_profile":"","show_links":"1","linka_name":"Wikipedia: Tamarind English","linka":"http:\\/\\/en.wikipedia.org\\/wiki\\/Tamarind","linkb_name":"Wikipedia: \\u09a4\\u09c7\\u0981\\u09a4\\u09c1\\u09b2  \\u09ac\\u09be\\u0982\\u09b2\\u09be  ","linkb":"http:\\/\\/bn.wikipedia.org\\/wiki\\/\\u09a4\\u09c7\\u0981\\u09a4\\u09c1\\u09b2 ","linkc_name":"Wikipedia: Tamarinier Fran\\u00e7ais","linkc":"http:\\/\\/fr.wikipedia.org\\/wiki\\/Tamarinier","linkd_name":"Wikipedia:Tamaline lea faka-Tonga","linkd":"http:\\/\\/to.wikipedia.org\\/wiki\\/Tamaline","linke_name":"","linke":"","contact_layout":"beez5:encyclopedia","show_email_form":"","show_email_copy":"","banned_email":"","banned_subject":"","banned_text":"","validate_session":"","custom_reply":"","redirect":""}', 0, 57, 1, '', '', '', '', '', '*', '2011-01-01 00:00:01', 0, 'Foreningen Joomla! i Norge', '2011-01-15 23:00:59', 44, '', '', '{"robots":"","rights":""}', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, 'Adresse', 'adresse', '', '', 'Vår by', 'Vårt fylke', 'Vårt land', '', '555-555-5555', '', '<p>Her er veibeskrivelsen for hvordan å komme til butikken vår.</p>', '', NULL, '', 0, 1, 0, '0000-00-00 00:00:00', 1, '{"show_contact_category":"","show_contact_list":"","presentation_style":"","show_name":"","show_position":"","show_email":"","show_street_address":"","show_suburb":"","show_state":"","show_postcode":"","show_country":"","show_telephone":"","show_mobile":"","show_fax":"","show_webpage":"","show_misc":"","show_image":"","allow_vcard":"","show_articles":"","show_profile":"","show_links":"","linka_name":"","linka":"","linkb_name":"","linkb":"","linkc_name":"","linkc":"","linkd_name":"","linkd":"","linke_name":"","linke":"","contact_layout":"","show_email_form":"","show_email_copy":"","banned_email":"","banned_subject":"","banned_text":"","validate_session":"","custom_reply":"","redirect":""}', 0, 35, 1, '', '', '', '', '', '*', '2011-01-01 00:00:01', 0, 'Foreningen Joomla! i Norge', '2011-01-14 22:59:10', 44, '', '', '{"robots":"","rights":""}', 1, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
