(1, 89, 'Administratorkomponenter', 'administratorkomponenter', '', '<p>Alle komponentene brukes også i administrasjonsdelen på din nettsiden. I tillegg til de som er listet opp her, finnes det også komponenter i administrasjonsdelen som ikke har egne vinduer på brukersiden. Disse er allikevel viktige da de er med å forme utseende og opplevelsen av nettsiden. De mest viktigste for de fleste er:</p>\r\n<ul>\r\n<li>Media</li>\r\n<li>Utvidelser</li>\r\n<li>Menyer</li>\r\n<li>Konfigurasjon</li>\r\n<li>Bannere</li>\r\n<li>Omadressering</li>\r\n</ul>\r\n<hr title="Media" alt="Media" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<p> </p>\r\n<h3>Media</h3>\r\n<p>Mediakomponenten gir deg anledningen til å laste opp og sette inn bilder i tekster på nettsiden din. Du kan også aktivere flash-opplaster som gir deg anledningen til å laste opp flere bilder samtidig. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Content_Media_Manager" target="_blank">Hjelp</a></p>\r\n<hr title="Utvidelser" alt="Utvidelser" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<h3>Utvidelser</h3>\r\n<p>Utvidelser gir deg anledningen til å installere, oppdatere, avinstallere og administrere alle dine utvidelser. Administrasjonen av utvidelser har gjennomgått en omfattende redesign for Joomla 2.5 samt at kjernefunksjonen installer og avinstaller forblir slik den var i Joomla 1.5. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Extension_Manager_Install" target="_blank">Hjelp</a></p>\r\n<hr title="Menyer" alt="Menyer" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<h3>Menyer</h3>\r\n<p>Menybehandlingen gir deg anledningen til å opprette menyer som du vil kunne se på nettsiden din. Denne komponenten gir deg også anledningen til å tillordne moduler og malutseende til spesifikke menylenker. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Menus_Menu_Manager" target="_blank">Hjelp</a></p>\r\n<hr title="Konfigurasjon" alt="Konfigurasjon" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<h3>Konfigurasjon</h3>\r\n<p>Nettsidens administrator kan benytte konfigurasjonskomponenten til å justere innstillinger på nettsiden slik som søkevennlige adresser, nettsidens metadata (beskrivende tekst som benyttes av søkemoterer og indekseringssystemer) og andre innstillinger. For mange nybegynnere vil det være smart å starte med standardinnstillingene. Når nettsiden skal publiseres for resten av verden bør metadata justeres slik at det stemmer overrens med nettsidens innhold. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Site_Global_Configuration" target="_blank">Hjelp</a></p>\r\n<hr title="Bannere" alt="Bannere" class="system-pagebreak" style="color: gray; border: 1px dashed gray;" />\r\n<h3>Bannere</h3>\r\n<p>Bannerkomponten gir en enkel mulighet for å vise vekslende bilder i en modul. Denne komponenten sporer også hvor mange ganger et bilde er blitt vist samt også trykket på. Det betyr at du kan på en enkel måte håndtere annonser på nettsiden din. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Banners_Banners_Edit" target="_blank">Hjelp</a></p>\r\n<hr title="Omadressering" class="system-pagebreak" />\r\n<h3>Omadressering</h3>\r\n<p>Komponenten for omadressering brukes til omadressering av brutte lenker hvor det ellers ville gitt; ”Side ikke funnet” (404). Hvis denne er aktivert vil det tillate deg å omadressere brutte koblinger til bestemte sider. Den kan også brukes til å håndtere migrasjonsrelatert nettadresseendringer. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Redirect_Manager" target="_blank">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 17:59:03', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 15, 0, 7, '', '', 1, 67, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(8, 104, 'Nybegynnere', 'nybegynnere', '', '<p>Om dette er din første Joomlaside, eller første nettside, er du kommet til riktig sted. Joomla vil hjelpe deg med å få din nettside opp og gå, raskt og enkelt.</p>\r\n<p>Start med å logge inn ved hjelp av administratorkontoen du opprettet når du installerte Joomla!.</p>\r\n', '\r\n<p>Utforsk artikler og andre ressurser  her på nettstedet for å finne ut mer om hvordan Joomla fungerer. (Når du  er ferdig med å utforske, kan du slette eller arkivere disse  eksempeldataene.) Det anbefales også at du besøker nybegynnerområdene på <a href="http://docs.joomla.org/Beginners" target="_blank">dokumentasjonssidene</a> og <a href="http://forum.joomla.org" target="_blank">forumet</a>.</p>\r\n<p>Det vil også være lurt å melde seg på e-postlistene for sikkerhetsmeldinger og kunngjøringer. For å få inspirasjon kan du besøke visningssidene for å se en rekke spennende måter folk bruker Joomla til å fortelle sine historier på nettet.</p>\r\n<p>Standardinstallasjonen av Joomla gir deg raskt et flott nettsted opp å gå. Når du er klar for flere funksjoner kommer det flotte med Joomla hvor du kan utvide nettstedet til nesten alt du måtte ønske deg. Besøk <a href="http://extensions.joomla.org/" target="_blank">biblioteket av Joomlautvidelser</a> for å se tusenvis av utvidelser som kan gjøre nesten alt du måtte ønske deg på et nettsted. Finner du ikke det du trenger? Da kan profesjonelle Joomlautviklere hjelpe deg på <a href="http://resources.joomla.org/" target="_blank" title="Resurskatalogen for Joomla!">resurskatalogen for Joomla!</a>.</p>\r\n<p>Vil du vite mer? Vurder å delta på en <a href="http://www.joomladay.no/" target="_blank" title="Joomladagene i Norge">Joomladag</a>, annen hendelse eller bli med en lokal <a href="http://www.joomlainorge.no" target="_blank">brukergruppe for Joomla</a>. Kan du ikke finne en nær deg? Start en selv.</p>', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:28:21', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 13, 0, 3, '', '', 1, 70, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(2, 90, 'Arkiverte artikler', 'arkiverte-artikler', '', '<p>Denne modulen viser liste over måneder  som inneholder arkivert innhold. Etter at du har valgt å arkivere en  artikkel, vil denne listen automatisk bli laget. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Articles_Archive" target="_blank" title="Archive Module">Hjelp</a></p>\r\n<p>{loadposition archiveload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:02:09', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 8, 0, 5, 'modules, content', '', 1, 28, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(7, 103, 'Bannermodulen', 'bannermodulen', '', '<p>Bannermodulen benyttes for å vise bannere som er administrert av bannerkomponenten i administrasjonsdelen. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Banners" target="_blank">Hjelp</a></p>\r\n<p>{loadposition bannersload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:22:14', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 6, '', '', 1, 28, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(3, 91, 'Artikkelkategorier', 'artikkelkategorier', '', '<p>Denne modulen viser en liste over kategorier fra en overordnet kategori. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Articles_Categories" target="_blank" title="Modul kategorier">Hjelp</a></p>\r\n<p>{loadposition articlescategoriesload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:02:53', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 9, 0, 6, 'modules, content', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(4, 92, 'Artikkelkategori', 'artikkelkategori', '', '<p>Denne modulen viser en liste over artikler fra en eller flere kategorier. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Articles_Category" target="_blank">Hjelp</a></p>\r\n<p>{loadposition articlescategoryload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:03:39', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 9, 0, 7, '', 'articles,content', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(5, 101, 'Autentifisering', 'autentifisering-authentification', '', '<p>Programtillegget autentifisering arbeider når brukere logger seg på brukersidene eller i administrasjonsdelen. Joomla-autentifisering er satt opp som standard i bruk. Du kan godt aktivere Gmail, LDAP eller installere et programtillegg for et annet system. Et eksempel er inkludert for å kunne benyttes til å lage et nyt autentifiseringprogramtillegg.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Joomla</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Gmail</li>\r\n<li>LDAP</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:16:39', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 3, '', '', 1, 29, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(6, 102, 'Australske parker', 'australske-parker', '', '<p><img src="images/sampledata/parks/banner_cradle.jpg" border="0" alt="Cradle Park Banner" /></p>\r\n<p>Velkommen!</p>\r\n<p>Dette er en enkel nettside om de vakre og fasinerende parkene i Australia.</p>\r\n<p>På denne siden kan du lese mer om mine turer til de forskjellige parkene, se på bilder og finne lenker til parkenes nettsider.</p>\r\n<p><em>Denne eksempelsiden er et eksempel på bruk av kjernefunksjoner i Joomla for å lage enkle nettsider, "brosjyrenettside", en personlig blog eller presentere informasjon om et eller annet emne du har interesse i.</em></p>\r\n<p><em> Les mer om nettstedet i modulen "Om parkene".</em></p>', '', 1, 0, 0, 26, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:21:10', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, '', '', 1, 77, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(9, 105, 'Kontakt', 'kontakt', '', '<p>Kontaktkomponenten gir anledningen til å presentere kontaktskjemaer og informasjon for din nettside. Du kan også lage en kompleks katalog som kan benyttes til mange forskjellige formål. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Contacts_Contacts" target="_blank">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:30:16', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 2, '', '', 1, 31, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(10, 106, 'Innhold', 'innhold', '', '<p>Innholdskomponenten (com_content) er den funksjonen som benyttes for å skrive artikler. Den er ekstrem fleksibel og har et stort antall av innebygde visninger. Denne komponenten gjør at du på en veldig enkel og grei måte kan opprette og redigere nettsideartikler fra brukersiden. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Content_Article_Manager" target="_blank">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-02-24 18:32:23', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, '', '', 1, 40, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(11, 107, 'Cradlefjellet', 'cradlefjellet', '', '<p><img src="images/sampledata/parks/landscape/250px_cradle_mountain_seen_from_barn_bluff.jpg" border="0" alt="Cradle Mountain" style="vertical-align: middle;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/landscape/800px_cradle_mountain_seen_from_barn_bluff.jpg" border="0" alt="Cradle Mountain" style="vertical-align: middle;" /></p>\r\n<p> </p>\r\n<p class="caption">Kilde: http://commons.wikimedia.org/wiki/File:Rainforest,bluemountainsNSW.jpg</p>\r\n<p class="caption">Skribent: Alan J.W.C.</p>\r\n<p class="caption">Lisens: GNU Free Documentation License v . 1.2 or later</p>', 1, 0, 0, 73, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:44:07', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 11, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(12, 110, 'Egendefinert HTML-modul', 'egendefinert-html-modul', '', '<p>Denne modulen gir deg anledningen til å opprette din egen HTML-modul ved å benytte en WYSIWYG tekstbehandler. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Custom_HTML" title="Egendefinert HTML modul">Hjelp</a></p>\r\n<p>{loadposition customload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 22:10:11', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 8, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(13, 111, 'Veivisere', 'veivisere', '', '<p>Slik finner du vår butikk.</p>\r\n<p>Ved kjøre bil</p>\r\n<p>Kjør langs hovedgaten til krysset ved First Avenue.  Se da etter vårt skilt.</p>\r\n<p>Ved å gå</p>\r\n<p>Fra sentrum av byen går du nordover i hovedgaten til du ser vårt skilt.</p>\r\n<p>Ved å ta bussen</p>\r\n<p>Ta buss nummer 73 til siste busstopp. Vi er da i nordøsthjørnet når du går ut av bussen.</p>', '', 1, 0, 0, 29, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-12 23:13:46', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 30, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(14, 112, 'Tekstbehandlere', 'tekstbehandlere-editors', '', '<p>Tekstbehandlere benyttes over alt i Joomla! hvor innhold er opprettet. TinyMCE er standard valget som benyttes i de fleste situasjoner. CodeMirror benyttes i administrasjonen av maler. Ingen tekstbehandler benyttes i tekstfelt for HTML innhold.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>CodeMirror Hjelp</li>\r\n<li>TinyMCE Hjelp</li>\r\n<li>Ingen tekstbehandler Hjelp</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Ingen</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 20:56:53', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 5, '', '', 1, 15, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(15, 113, 'Tekstbehandlere utvidet', 'tekstbehandlere-utvidet-editors-xtd', '', '<p>Disse programtilleggene finnes under tekstbehandleren din. Disse blir bare kjørt når en tekstbehandlings-programtillegg blir kjørt.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Tekstbehandlerknapp: Bilde</li>\r\n<li>Tekstbehandlerknapp: Les mer</li>\r\n<li>Tekstbehandlerknapp: Sideskift</li>\r\n<li>Tekstbehandlerknapp: Artikkel</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Ingen</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 21:05:09', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 5, 0, 6, '', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(16, 114, 'Nyhetsmating', 'nyhetsmating', '', '<p>Denne modulen gir deg anledningen til å vise en nyhetsmating. <a href="http://docs.joomla.org/Help15:Screen.modulessite.edit.15#Feed_Display" title="Nyhetsmatingsmodul">Hjelp</a></p>\r\n<p>{loadposition feeddisplayload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:56:42', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 2, '', '', 1, 10, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
