(19, 117, 'Bunntekstmodul', 'bunntekstmodul', '', '<p>Denne modulen viser Joomla! kopibeskyttelsesinformasjonen. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Footer" title="Bunntekstmodul">Hjelp</a></p>\r\n<p>{loadposition footerload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:58:18', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 3, '', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(20, 118, 'Fruktbutikk', 'fruktbutikk', '', '<h2>Velkommen til fruktbutikken</h2>\r\n<p>Vi selger frukt fra hele verden. Vennligst benytt vår nettside for å finne mer ut om vår forretning. Vi håper du vil komme til vår butikk og kjøpe noe frukt.</p>\r\n<p><em>Denne mini-nettsiden vil vise deg hvordan du kan sette opp en nettside for din forretning hvis du f.eks. selger frukt. Vi vil vise hvordan du kan sette opp tilgangsnivåer for å kontrollere tilgangen til nettsidens innhold. Hvis du setter opp en reel nettside vil det kanskje være av interesse å utvide funksjonaliteten med nettbutikk, en katalog, nyhetsbrev eller andre utvidelser. Mange av disse utvidelsene kan du allerede finne i </em><a href="http://extensions.joomla.org"><em>Joomla! utvidelseskatalog</em></a>.</p>\r\n<p><em>For å få fullt utbytte av denne nettsiden bør du nok opprette en bruker med rettigheten kundegruppe og en annen med rettigheten leverandører. Ved å logge inn med de forskjellige brukerne vil du få se hvordan tilgangskontrollen fungerer.</em></p>', '', 1, 0, 0, 29, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-16 00:00:07', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 40, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(21, 119, 'Finne hjelp', 'finne-hjelp', '', '<p><img class="image-left" src="administrator/templates/hathor/images/header/icon-48-help_header.png" border="0" /> Det finnes mange steder du kan få hjelp med Joomla!.</p>\r\n<p>På en del sider vil du se et hjelpesymbol (rød-hvit runding/livbøye). Ved å trykke på denne vil det da åpnes en ny side med hjelp og informasjon om funksjonene på den siden du befinner deg på.</p>\r\n<ul>\r\n<li><a href="http://forum.joomla.org">Supportforumer</a></li>\r\n<li><a href="http://docs.joomla.org">Dokumentasjon</a></li>\r\n<li><a href="http://resources.joomla.org">Profesjonelle</a></li>\r\n<li><a href="http://shop.joomla.org/amazoncom-bookstores.html">Bøker</a></li>\r\n</ul>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 22:42:17', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 8, '', '', 1, 26, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(22, 120, 'Komme i gang', 'komme-i-gang', '', '<p>Det er enkelt å komme i gang med å lage din nettside. Det vil også være lettere hvis du kjenner til noen grunnleggende ting.</p>\r\n<h3>Hva er en publiseringsløsning (CMS)?</h3>\r\n<p>Et content management system (CMS) eller publiseringsløsning på norsk,  omhandler utvikling, publisering, vedlikehold og redigering av innhold  på nettsider. Det inneholder verktøy for å lage, strukturere og  presentere websidene.</p>\r\n<p>På dette nettstedet er alt innholdet lagret i en <em>database</em>. Utseende og opplevelsen gjøres ved hjelp av maler (<em>template)</em>. Joomla!løsningen setter sammen maler og innholdet slik at det blir presentert som en ferdig nettside.</p>\r\n<h3>Brukerside og administrasjonside</h3>\r\n<p>Nettstedet ditt har faktisk to seperate nettsteder. Brukersiden (også kalt for front end) er hva dine besøkende vil se. Administrasjonsiden  (også kalt for back end) benyttes bare av personer som skal vedlikeholde og arbeide med selve nettstedet. Du kan få tilgang til administrasjonsiden ved å tryke på "Sideadministrasjon" under menyen "Denne siden". Du kan også gå direkte til administrasjonsiden ved å legge til /administrator etter domenenavnet.</p>\r\n<p>Logg inn på administrasjonsiden ved å benytte brukernavnet og passordet som ble opprettet under installasjonen av Joomla!.</p>\r\n<h3>Logge inn</h3>\r\n<p>Du kan logge inn på brukersiden ved å benytte innloggingskjemaet eller logg inn lenken under menyen "Denne siden". Benytt brukernavnet og passordet som ble opprettet under installasjonen. Så snart du har logget inn vil du få tilgang til å opprette og redigere artikler.</p>\r\n<p>Under administrasjonen av ditt nettsted kan du opprette innhold som bare innloggede brukere kan se.</p>\r\n<h3>Opprette en artikkel</h3>\r\n<p>Så snart du har logget inn vil det komme frem en ny meny.  For å opprette en ny artikkel trykker du på "Skriv en artikkel" lenken i den nye menyen.</p>\r\n<p>Redigeringsvinduet for artikkel som kommer frem vil gi deg flere forskjellige valg. De to viktigste valgene vil være å gi artikkelen en tittel og noe tekst i innholdsfeltet. For at det skal være enkelt å finne den igjen, setter du statusen til å være publisert. Legg den så gjerne i Joomla! kategorien.</p>\r\n<div>Du kan redigere en eksisterende artikkel ved å trykke på redigeringssymbolet (hvis tilgjengelig).</div>\r\n<h3>Lær mer</h3>\r\n<p>Det finnes mye mer å lære i Joomla! for å få en nettside slik du har drømt om. Du kan lære mer om andre funksjoner på <a href="http://docs.joomla.org">Joomla! dokumentasjonsiden</a> og i <a href="http://forum.joomla.org">Joomla!forumene</a>.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 23:08:41', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 9, '', '', 1, 95, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(23, 121, 'Flott appelsinhagen', 'flott-appelsinhagen', '', '<p>I frukthagen vår dyrker vi verdens beste appelsiner samt andre sitrusfrukter som sitroner og grapefrukt. Vår familie har stelt denne frukthage i generasjoner.</p>', '', 1, 0, 0, 30, '2011-01-01 00:00:01', 42, 'Nettredaktør fruktbutikk', '2011-01-14 18:00:07', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 11, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(24, 122, 'Norsk Joomla!', 'joomla', '', '<p>Gratulerer, du har nå en norsk Joomlaside. Joomla gjør det enkelt å bygge en nettside, akkurat slik du ønsker den – som også er enkel å oppdatere og vedlikeholde.</p>\r\n<p>Joomla! er en fleksibel og kraftig plattform, enten du bygger en liten side for deg selv, eller en diger side med flere hundretusen besøkende. Joomla er åpen kildekode, som betyr at du kan tilpasse løsningen akkurat slik du måtte ønske.</p>\r\n<p>Den norske oversettelsen av Joomla er gjort mulig gjennom flere enkeltpersoners utrettelige innsats gjennom flere år, uten noen form for betaling eller motytelser – annet enn gleden av å hjelpe deg og andre ut på nett med norsk programvare<strong>.</strong> Og selvfølgelig, et håp om at også du etterhvert skal se nytten og gleden i å bidra til disse frie løsningene og oversettelsene gjennom fellesskapet bygget rundt <a href="http://www.joomlainorge.no/" target="_blank" title="Besøk hjemmesiden til Foreningen Joomla! i Norge">Foreningen Joomla! i Norge</a>.</p>\r\n', '\r\n<h3><br />Det er mange måter du kan bidra til norsk Joomla på</h3>\r\n<p><img src="images/sampledata/joomlainorge/knapper/bidra.png" border="0" alt="Hvordan bidra til norsk Joomla!" title="Hvordan bidra til norsk Joomla!" style="margin-left: 5px; border: 0pt none; float: right;" />Den mest verdifulle måten du kan bidra på er med din tid. Dette kan være å hjelpe andre i <a href="http://forum.joomla.org/viewforum.php?f=97" target="_blank" title="Vis de norske forumene på joomla.org">forumene</a>, delta aktivt i det norske samfunnet på <a href="http://www.joomlainorge.no/brukere" target="_blank" title="Vis den norske møteplassen for Joomlabrukerne">joomlainorge.no/brukere</a> m.m.<br /><a href="http://www.joomlainorge.no/foreningen/hvordan-bidra" target="_blank" title="Vis mer om hvordan jeg kan bidra">Les mer om å bidra …</a></p>\r\n<p><img src="images/sampledata/joomlainorge/knapper/deloversettelse.png" border="0" alt="Del din norske oversettelse for Joomlautvidelser" title="Del din norske oversettelse for Joomlautvidelser" style="margin-left: 5px; border: 0pt none; float: right;" />Man behøver bare en gratis brukerkonto på <a href="http://www.joomlainorge.no/" target="_blank" title="Vis Foreningen Joomla! i Norges nettside">joomlainorge.no</a> for å laste oversatte språkfiler direkte opp i filarkivet, og man kan også sende filene inn via e-post.<br /><a href="http://www.joomlainorge.no/foreningen/hvordan-bidra/569-hvordan-bidra-med-oversettelser" target="_blank" title="Vis mer om hvordan jeg kan bidra med med oversettelser">Les mer om å bidra med oversettelser …</a></p>\r\n<p><img src="images/sampledata/joomlainorge/knapper/blimedlem.png" border="0" alt="Bli medlem i foreningen Joomla! i Norge" title="Bli medlem i foreningen Joomla! i Norge" style="margin-left: 5px; border: 0pt none; float: right;" />Ved medlemskap støtter du ikke bare driften av foreningen, men også Joomla ettersom mesteparten av kontingenten føres tilbake til medlemmene i form av støtte til Joomla.<br /><a href="http://www.joomlainorge.no/foreningen/medlemskap" target="_blank" title="Vis mer om medlemskap i Foreningen Joomla! i Norge">Les mer om medlemskap i foreningen …</a></p>\r\n<p> </p>\r\n<h3>Om Foreningen Joomla! i Norge</h3>\r\n<p><a href="http://w2.brreg.no/enhet/sok/detalj.jsp?orgnr=990126658" target="_blank" title="Oppføring i Brønnøysund">Foreningen Joomla! i Norge ble stiftet i 2006</a> med formål å være en partsnøytral forening for oversettere, brukere og leverandører av Joomla! her i landet.</p>\r\n<p>Alt arbeidet som foreningen utfører er i form av en felles dugnadsinnsats mellom foreningens medlemmer og brukere. Det er foreningens betalende medlemmer som er "Foreningen Joomla! i Norge". Dette er en <a href="http://no.wikipedia.org/wiki/Ideell_organisasjon" target="_blank" title="Om ideelle organisasjoner på Wikipedia">ideell/frivillig organisasjon</a> hvor ingen har lønn for sitt arbeide.</p>\r\n<p>Foreningen arbeider for å utbre bruken av <a href="http://www.joomlainorge.no/foreningen/om-joomla" target="_blank" title="Vis mer om Joomla! publiseringsløsning">Joomla! publiseringsløsning</a>, og bidrar til dette ved å oversette til norsk, samt dokumentere bruk av denne løsningen.</p>\r\n<p><a href="Informasjon%20om%20Joomla!%20User%20Groups" target="_blank" title="Informasjon om Joomla! Translation Teams"><img src="images/sampledata/joomlainorge/joomla_transteam_sm.png" border="0" alt="joomla_transteam_sm.png" title="joomla_transteam_sm.png" style="margin-left: 5px; border: 0pt none; float: right;" /></a>Foreningen Joomla! i Norge, ved koordinator Rune Rasmussen, er registrert som den norske oversettelsesgruppen for Joomla!. <a href="http://community.joomla.org/translations.html" target="_blank" title="Les mer om oversettelsesgruppene her">Les mer om oversettelsesgruppene her ...</a></p>\r\n<p><a href="http://community.joomla.org/user-groups.html" target="_blank" title="Informasjon om Joomla! User Groups"><img src="images/sampledata/joomlainorge/joomla_rug_sm.png" border="0" alt="joomla_rug_sm.png" title="joomla_rug_sm.png" style="margin-left: 5px; border: 0pt none; float: right;" /></a>Foreningen Joomla! i Norge er også registrert som en norsk brukergruppe/-forening for Joomla i Norge. <a href="http://community.joomla.org/user-groups.html" target="_blank" title="Les mer om, og finn andre, brukergrupper her.">Les mer om, og finn andre, brukergrupper her ...</a></p>', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2012-01-29 15:10:45', 42, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 61, 0, 2, '', '', 1, 173, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(25, 123, 'Koala', 'koala', '', '<p><img src="images/sampledata/parks/animals/180px_koala_ag1.jpg" border="0" alt="Koala  Thumbnail" width="180" height="123" style="vertical-align: middle; border: 0;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/animals/800px_koala_ag1.jpg" border="0" alt="Koala Climbing Tree" width="500" height="341" style="vertical-align: middle; border: 0;" /></p>\r\n<p> </p>\r\n<p> </p>\r\n<p class="caption">Kilde: http://commons.wikimedia.org/wiki/File:Koala-ag1.jpg</p>\r\n<p class="caption">Skribent: Arnaud Gaillard</p>\r\n<p><span class="caption">Lisens: Creative Commons Share Alike Attribution Generic 1.0</span></p>', 1, 0, 0, 72, '2011-01-01 00:00:01', 42, 'Nettredaktør parker', '2011-01-13 22:30:17', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(26, 124, 'Språkbyttemodul', 'sprakbyttemodul', '', '<p>Språkbyttemodulen gir deg anledningen til å arbeide med flerspråklige funksjoner som er tilgjengelig når innhold, moduler og menyer blir opprettet.</p>\r\n<p>Denne modulen vil vise en liste over tilgjengelige innholdsspråk slik at man kan bytte mellom dem.</p>\r\n<p>Ved bytte av språk vil fremsiden bli byttet til det valgte språket. Deretter vil all navigering på sidene følge det språket som er valgt.</p>\r\n<p><strong>Programtillegget språkfilter må være aktivert for at denne modulen skal kunne fungere skikkelig.</strong></p>\r\n<p><strong></strong> <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Language_Switcher" title="Språkbyttemodul">Hjelp</a></p>\r\n<p>For å se eksempel på språkbyttemodulen må du gå til administrasjonsiden og slå på programtillegget språkfilter. Deretter må du også slå på modulen "Språkbytte". Deretter kan du se på eksempelsidene fruktbutikken eller parker. Følg deretter <a href="http://docs.joomla.org/Language_Switcher_Tutorial_for_Joomla_1.6">instruksjonene i denne veiledningen</a>.</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 23:44:44', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 3, '', '', 1, 18, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(27, 125, 'Siste artikler', 'siste-artikler', '', '<p>Denne modulen viser en liste over de  siste aktive artiklene (noen artikler kan være utløpt på dato selv om de  er blant de siste artiklene). <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Latest_News" title="Latest Articles">Hjelp</a></p>\r\n<p>{loadposition articleslatestload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:20:44', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, 'modules, content', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(28, 126, 'Innloggingsmodul', 'innloggingsmodul', '', '<p>Denne modulen viser et skjem for å angi brukernavn og passord. Den viser også en lenke for å gjenopprette et glemt passord. Hvis brukerregistrering er aktivert (i Global Konfigurasjon), vil også en lenke for registrering bli vist. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Login" title="Innlogging">Hjelp</a></p>\r\n<p>{loadposition loginload}</p>', '', 1, 0, 0, 65, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:54:11', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 14, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(29, 127, 'Menymodulen', 'menymodulen', '', '<p>Denne modulen viser menyer på siden (brukersiden). Menyer kan vises på en rekke forskjellige måter ved hjelp av menyvalgene og css menystiler. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Menu">Hjelp</a></p>\r\n<p>{loadposition menuload}</p>', '', 1, 0, 0, 75, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:47:37', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(30, 128, 'Mest leste innhold', 'mest-leste-innhold', '', '<p>Denne modulen viser en liste over publiserte artikler som har blitt lest flest ganger. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Most_Read" title="Most Read Content">Hjelp</a></p>\r\n<p>{loadposition articlespopularload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:22:31', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 2, 'modules, content', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(31, 129, 'Siste nyheter', 'siste-nyheter', '', '<p>Denne modulen viser et gitt antall artikler fra en kategori bestemt på dato eller et tilfeldig valg. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Articles_Newsflash" title="Nyhetsmodul">Hjelp</a></p>\r\n<p>{loadposition newsflashload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:28:44', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 3, 'modules, content', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(32, 130, 'Parametre', 'parametre', '', '<p>Etter hvert som du lager ditt Joomla! nettsted med bruk av utvidelsene vil du kontrollere detaljene i visningen ved hjelp av <em>parametrene</em><strong></strong>. Parametrene styrer alt fra om skribentens navn skal vises til hvem som kan se hva til antall elementer som vises i listene.</p>\r\n<p>Standard parametrene for hver komponent endres ved hjelp av knappen innstillinger på komponenten verktøylinjen.</p>\r\n<p>Parametrene kan også settes på et enkelt element, slik som for en artikkel eller kontakt og i menyene.</p>\r\n<p>Hvis du er fornøyd med hvordan nettsiden ser ut, er det greit å la alle parametrene være slik de er satt når nettstedet ble installert. Etter hvert som du blir mer erfaren med Joomla! vil du bruke parametrene mer.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:36:08', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 10, '', '', 1, 37, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(33, 131, 'Nålefisk', 'nalefisk', '', '<p><img src="images/sampledata/parks/animals/200px_phyllopteryx_taeniolatus1.jpg" border="0" style="vertical-align: middle;" /></p>\r\n<p> </p>\r\n', '\r\n<p><img src="images/sampledata/parks/animals/800px_phyllopteryx_taeniolatus1.jpg" border="0" style="vertical-align: middle;" /></p>\r\n<p> </p>\r\n<p>Kilde: http://en.wikipedia.org/wiki/File:Phyllopteryx_taeniolatus1.jpg</p>\r\n<p>Skribent: Richard Ling</p>\r\n<p>Lisens: GNU Free Documentation License v 1.2 or later</p>', 1, 0, 0, 72, '2011-01-01 00:00:01', 42, 'Nettredaktør parker', '2011-01-13 22:28:49', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 3, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(34, 132, 'Pinnacles', 'pinnacles', '', '<p><img src="images/sampledata/parks/landscape/120px_pinnacles_western_australia.jpg" border="0" alt="Kings Canyon" width="120" height="90" style="vertical-align: middle; border: 0;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/landscape/800px_pinnacles_western_australia.jpg" border="0" alt="King''s Canyon" width="500" height="374" style="vertical-align: middle; border: 0;" /></p>\r\n<p> </p>\r\n<p class="caption">Kilde: http://commons.wikimedia.org/wiki/File:Pinnacles_Western_Australia.jpg</p>\r\n<p class="caption">Skribent: Martin Gloss</p>\r\n<p class="caption">Lisens: GNU Free Documentation license v 1.2 or later.</p>', 1, 0, 0, 73, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:45:26', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 4, '', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(35, 133, 'Profesjonelle', 'profesjonelle', '', '<p>Joomla! 2.5 viderefører utviklingen av Joomlas rammeverk og CMS, som en sterk og fleksibel måte å virkeliggjøre dine visjoner for Internett. Nå som administrasjonen er fullt ut MVC, er muligheten til å kontrollere dens utseende og behandlingen av utvidelser komplett.</p>\r\n', '\r\n<p>Å jobbe med flere malstiler og overstyring for de samme visningene,å  skape det designet du ønsker er nå lettere enn det noen gang har vært.  Begrense støtte til PHP 5.2.4 og over og avslutte bakoverkompabilitet for Joomla 1.0 utvidelser gjør  Joomla! lettere og raskere enn noensinne. Språkfiler kan nå overstyres  uten at endringene går tapt under en oppgradering. Med riktig xml,  oppdateres dine utvidelser med et enkelt klikk.</p>\r\n<p>Adgangskontroll (ACL) er nå inkorporert ved bruk av et nytt system  utviklet for Joomla! ACL systemet er designet med utviklere i tankene,  så det blir enkelt å innlemme i dine utvidelser. Det nye nestede  biblioteket tillater deg å innlemme uendelig dybde i kategorier, men  også å bruke nestede sett på en rekke andre måter.</p>\r\n<p>Et nytt skjemabibliotek gjør oppretting av alle typer brukerinteraksjon enkel. MooTools 1.3 gir et svært fleksibelt javaskript rammeverk som er et stort fremskritt over MooTools 1.0..</p>\r\n<p>Les mer om:</p>\r\n<ul>\r\n<li><a href="http://docs.joomla.org/What''s_new_in_Joomla_1.6">Endringer siden 1.5</a></li>\r\n<li><a href="http://docs.joomla.org/ACL_Tutorial_for_Joomla_1.6">Jobbe med ACL</a></li>\r\n<li><a href="http://docs.joomla.org/API16:JCategories">Jobbe med nestede kategorier</a></li>\r\n<li><a href="http://docs.joomla.org/API16:JForm">Bruke skjemabiblioteket</a></li>\r\n<li><a href="http://docs.joomla.org/Working_with_Mootools_1.3">Jobbe med Mootools 1.3</a></li>\r\n<li><a href="http://docs.joomla.org/Layout_Overrides_in_Joomla_1.6">Bruke nye muligheter med overstyring</a></li>\r\n<li><a href="http://docs.joomla.org/API16:Framework">Joomla! 2.5 API</a>I</li>\r\n<li><a href="http://docs.joomla.org/API16:JDatabaseQuery">Bruke JDatabaseQuery</a></li>\r\n<li><a href="http://docs.joomla.org/What''s_new_in_Joomla_1.6#Events">Hva er nytt og hva er oppdatert i J2.5</a></li>\r\n<li><a href="http://docs.joomla.org/Xml-rpc_changes_in_Joomla!_1.6">Xmlrpc</a></li>\r\n<li><a href="http://docs.joomla.org/What''s_new_in_Joomla_1.6#Extension_management">Installere og oppdatere utvidelser</a></li>\r\n<li><a href="http://docs.joomla.org/Setting_up_your_workstation_for_Joomla!_development">Sette opp utviklingsmiljø</a></li>\r\n</ul>', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-12 23:19:47', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 7, 0, 6, '', '', 1, 56, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(36, 134, 'Modul Tilfeldig bilde', 'modul-tilfeldig-bilde', '', '<p>Denne modulen viser tilfeldige bilder fra en valgt mappe med bilder. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Random_Image" title="Modul tilfeldig bildee">Hjelp</a></p>\r\n<p>{loadposition randomimageload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:18:20', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 4, '', '', 1, 24, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(37, 135, 'Relaterte artikler', 'relaterte-artikler', '', '<p>Denne modulen viser andre artikler som  er relatert til den artiklen som for tiden vises. Det er artiklenes  nøkkelord som bestemmer. Alle nøkkelord i den aktive artiklen blir sammenliknet med nøkkelord i alle de andre publiserte artiklene. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Articles_Related" title="Modul relaterte artikler">Hjelp</a></p>\r\n<p>{loadposition relateditemsload}</p>', '', 1, 0, 0, 64, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:33:55', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 4, 'modules, content', '', 1, 18, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(38, 136, 'Demosider', 'demosider', '', '<p>Denne installasjonen inneholder eksempeldata laget for å vise deg noen av alternativene du har for å bygge ditt nettsted. I tillegg til informasjon om Joomla! er det to eksempelsider ”innenfor et nettsted" laget for å hjelpe deg i gang med å lage ditt eget nettsted.</p>\r\n<p>Det første området er en enkel side om <a href="index.php?Itemid=243">australske parker</a>. Det viser deg at du raskt og enkelt kan bygge et personlig område med bare de byggeklossene som er en del av Joomla! Det omfatter en personlig blogg, nettlenke, og et veldig enkel bildegalleri.</p>\r\n<p>Den andre siden er litt mer komplisert og viser hva du kan gjøre hvis du bygger et nettsted for en liten bedrift, i dette tilfellet en <a href="index.php/welcome.html"></a><a href="index.php?Itemid=429">fruktbutikk</a>.</p>\r\n<p>Uansett type nettsted du ønsker å lage ønsker du mest sannsynlig å legge til <a href="http://extensions.joomla.org">utvidelser</a> og enten lage eller kjøpe din egen mal. Mange Joomla! brukere starter ved å endre <a href="http://docs.joomla.org/How_do_you_modify_a_template%3F"> malene</a> som følger med kjerneinstallasjonen slik at de inkluderer spesielle bilder og andre designelementer som er relatert til ditt nettsted.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:14:45', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 11, '', '', 1, 126, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(39, 137, 'Søk', 'soke-komponenten', '', '<p>Søkekomponenten gir grunnleggende søkefunksjonalitet for informasjonen fra dine kjernekomponenter. Mange tredjepartsutvidelser bruker også søkekomponenten. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Search">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:50:09', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 3, '', '', 1, 34, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(40, 138, 'Søkemodul', 'sokemodul', '', '<p>Denne modulen vil vise en søkeboks. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Search" title="Søk">Hjelp</a></p>\r\n<p>{loadposition searchload}</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:37:19', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 4, '', '', 1, 14, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(41, 139, 'Søk', 'sok-programtillegg', '', '<p>Søke komponenten bruker programtillegg for å kontrollere hvilke deler av ditt Joomla! området som er søkbart. Du kan velge å slå av noen områder for å forbedre ytelsen eller av andre grunner. Mange tredjeparts utvidelser har egne søkeprogramtillegg som utvider søkeområdet.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Innhold Hjelp</li>\r\n<li>Kontakter Hjelp</li>\r\n<li>Nettlenker Hjelp</li>\r\n<li>Nyhetsmatning Hjelp</li>\r\n<li>Kategorier Hjelp</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:44:20', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(42, 140, 'Nettstedskart', 'site-map', '', '<p>{loadposition sitemapload}</p>\r\n<p><em>Ved å legge alt innholdet ditt inn i nestede kategorier kan du gi brukere og søkemotorer tilgang til alt med å bruke menyer.</em></p>', '', 1, 0, 0, 14, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:27:36', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 72, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(43, 141, 'Prikkete pungdyr', 'prikkete-pungdyr', '', '<p><img src="images/sampledata/parks/animals/220px_spottedquoll_2005_seanmcclean.jpg" border="0" alt="Spotted Quoll" style="vertical-align: middle; border: 0;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/animals/789px_spottedquoll_2005_seanmcclean.jpg" border="0" alt="Spotted Quoll" style="vertical-align: middle;" /></p>\r\n<p> </p>\r\n<p>Kilde: http://en.wikipedia.org/wiki/File:SpottedQuoll_2005_SeanMcClean.jpg</p>\r\n<p>Skribent: Sean McClean</p>\r\n<p>Lisens: GNU Free Documentation License v 1.2 or later</p>', 1, 0, 0, 72, '2011-01-01 00:00:01', 42, 'Nettredaktør parker', '2011-01-13 22:27:06', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 4, '', '', 1, 15, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(44, 142, 'Statistikkmodulen', 'statistikkmodulen', '', '<p>Statistikkmodulen viser informasjon om din server sammen med statistikk på brukere, antall artikler i databasen og antall nettlenker.</p>\r\n<p>{loadposition statisticsload}</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:22:47', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 5, '', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(45, 143, 'Syndikatmodulen', 'syndikatmodulen', '', '<p>Med syndikatmodulen kan du vise en kobling som lar brukerne hente nyheter fra side. Det vil kun vises på sider som nyhetsmatning er mulig. Det betyr at den ikke vil vises på en enkel artikkel, kontakt eller nettlenkesider, slik som denne. <a href="http://docs.joomla.org/Help15:Screen.modulessite.edit.15#Syndicate" title="Synicate Module">Hjelp</a></p>\r\n<p>{loadposition syndicateload}</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 23:48:20', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 6, '', '', 1, 11, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(46, 144, 'System', 'system', '', '<p>Programtilleggene System opererer hver gang en side på nettstedet ditt lastes. De kontrollerer slike ting som nettadresser, om brukerne kan huke av for "husk meg" på innloggingsmodulen, og om bufring er aktivert. Nytt i 2.5 er programtillegget for omadressering som sammen med komponenten for omadressering hjelper deg med å håndtere endringer i nettadresser.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Husk meg Hjelp</li>\r\n<li>SEF Hjelp</li>\r\n<li>Feilsøking Hjelp</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Mellomlagring Hjelp</li>\r\n<li>Logg Help</li>\r\n<li>Omadressering Hjelp</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 20:19:19', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 2, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(47, 145, 'Joomla!-samfunnet', 'joomla-samfunnet', '', '<p>Joomla! betyr ”som en helhet”, og er et fellesskap av mennesker som arbeider og har det gøy sammen som gjør Joomla! mulig. Tusenvis av mennesker deltar hvert år i Joomla!-samfunnet, og vi håper du vil være en av dem.</p>\r\n<p>Folk med alle typer ferdigheter, på alle ferdighetsnivåer og fra hele verden er velkommen til å delta. Delta i <a href="http://joomla.org">Joomla.org</a> familien av nettsteder (<a href="http://forum.joomla.org">Forumet </a>er et flott sted å starte). Kom til et <a href="http://community.joomla.org/events.html">Joomla! arrangement</a>. Delta i eller starte en <a href="http://community.joomla.org/user-groups.html">Joomla! brukergruppe</a>. Enten du er utvikler, administrator, designer, sluttbruker eller fan, det finnes måter for alle å delta og bidra.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-16 21:22:41', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 4, '', '', 1, 52, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(48, 146, 'Joomla!-prosjektet', 'joomla-prosjektet', '', '<p>Joomla-prosjektet består av alle de menneskene som lager og støtter Joomla! plattformen og publiseringsløsningen.</p>\r\n<p>Vår misjon er å tilby en fleksibel plattform for digital publisering og samarbeid.</p>\r\n<p>Kjerneverdiene:</p>\r\n<ul>\r\n<li>Frihet</li>\r\n<li>Likestilling</li>\r\n<li>Tillit</li>\r\n<li>Fellesskapet</li>\r\n<li>Samarbeid</li>\r\n<li>Brukervennlighet</li>\r\n</ul>\r\n<p>I vår visjon, ser vi:</p>\r\n<ul>\r\n<li>Folk publiserer og samarbeid i sine lokale samfunn rundt om i verden</li>\r\n<li>Programvare som er gratis, sikker og av høy kvalitet</li>\r\n<li>Et samfunn som er hyggelig og givende å delta i</li>\r\n<li>Folk rundt i verden bruke sitt foretrukne språk</li>\r\n<li>Et prosjekt som fungerer selvstendig</li>\r\n<li>Et prosjekt som er sosialt ansvarlig</li>\r\n<li>Et prosjekt dedikert til å opprettholde tillit fra sine brukere</li>\r\n</ul>\r\n<p>Det finnes millioner av brukere over hele verden og tusener av mennesker som bidrar til Joomla! prosjektet. De arbeider i tre hovedgrupper: produksjon gruppen, er ansvarlig for alt som går inn programvaren og dokumentasjonen; Fellesskapsgruppen, ansvarlig for å opprette og pleie fellesskapet, og Open Source Matters, den ideelle organisasjon som er ansvarlig for å administrere juridiske, økonomiske og organisatoriske spørsmål.</p>\r\n<p>Joomla! er en fri og åpent kildekode-prosjekt, som bruker GNU General Public License versjon 2 eller senere.</p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 19:48:59', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 63, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(49, 147, 'Typografi', 'typografi', '', '<h1>H1 ABCDEFGHIJKLMNOPQRSTUVWXYZÆØÅ abcdefghijklmonpqrstuvwzyzæøå</h1>\r\n<h2>H2 ABCDEFGHIJKLMNOPQRSTUVWXYZÆØÅ abcdefghijklmonpqrstuvwzyzæøå</h2>\r\n<h3>H3 ABCDEFGHIJKLMNOPQRSTUVWXYZÆØÅ abcdefghijklmonpqrstuvwzyzæøå</h3>\r\n<h4>H4 ABCDEFGHIJKLMNOPQRSTUVWXYZÆØÅ abcdefghijklmonpqrstuvwzyzæøå</h4>\r\n<h5>H5 ABCDEFGHIJKLMNOPQRSTUVWXYZÆØÅ abcdefghijklmonpqrstuvwzyzæøå</h5>\r\n<h6>H6 ABCDEFGHIJKLMNOPQRSTUVWXYZÆØÅ abcdefghijklmonpqrstuvwzyzæøå</h6>\r\n<p>Mikkel Rev, satt og skrev, på ei lita tavle. MIKKEL REV, SATT OG SKREV, PÅ EI LITA TAVLE</p>\r\n<ul>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt<br /> \r\n<ul>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt<br /> \r\n<ul>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ol>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt<br /> <ol>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt<br /><ol>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n<li>Punkt</li>\r\n</ol></li>\r\n</ol> </li>\r\n</ol>', '', 1, 0, 0, 23, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 15:38:16', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, '', '', 1, 66, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(50, 148, 'Oppgradere', 'oppgradere', '', '<p>Om du er en erfaren Joomla! 1.5 bruker vil 2.5 være kjent. Det er nye designmaler og forbedret brukergrensesnitt, men de fleste funksjoner er like. De største endringene er forbedret tilgangskontroll (ACL) og kategorinivåer.</p>\r\n', '\r\n<p>Den nye brukerbehandleren lar deg styre hvem som har tilgang til hva på  nettstedet ditt. Du kan la tilgangsgrupper være akkurat slik du hadde  dem i Joomla 1.5 eller gjøre dem så komplisert som du vil. Du kan lære  mer om hvordan <a href="http://docs.joomla.org/ACL_Tutorial_for_Joomla_1.6">adgangskontroll fungerer</a> på <a href="http://docs.joomla.org">dokumentasjonssidene</a></p>\r\n<p>I Joomla 1.5 og 1.0 ble innholdet organisert i seksjoner og kategorier. I  2.5 er seksjoner borte, men du kan opprette kategorier innen  kategorien, og ha så mange nivå som du vil. Eksempeldataene gir mange  eksempler på bruk av nestede kategorier.</p>\r\n<p>Alle utforming er redesignet for bedre tilgjengelighet og fleksibilitet.  Hvis du ønsker å beholde 1.5 oppsett, kan du finne dem i html-mappen på  malen MilkyWay. Det er bare å kopier oppsett du vil ha til html-mappen i  malen du bruker.</p>\r\n<p>Oppdatering av nettstedet og utvidelsene er enklere enn noensinne takket være forbedringene i installasjonen.</p>', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-12 23:19:36', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 6, 0, 5, '', '', 1, 52, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(51, 149, 'Bruker', 'bruker-programtillegg', '', '<p>Standard på:</p>\r\n<ul>\r\n<li>Joomla Hjelp</li>\r\n</ul>\r\n<p>Standard av:</p>\r\n<p>To nye programtillegg er tilgjengelig i 2.5, men er som standard deaktivert.</p>\r\n<ul>\r\n<li>Opprette kontakter Hjelp<br />Oppretter en ny lenket kontakt for hver nye bruker som opprettes. </li>\r\n<li>Profil Hjelp<br />Med dette profilprogramtillegget (som et eksempel) kan du sette inn flere felt i brukerregistreringen og visning av profilen. Dette er ment som et eksempel på hvilke typer felt du kan ønske å opprette til profilen. </li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 22:38:55', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 4, '', '', 1, 31, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(52, 150, 'Brukere', 'brukerkomponenten', '', '<p>Brukerkomponenten lar besøkende på nettstedet registrere seg, logg inn og ut, endre passord og annen informasjon, og gjenopprette glemt passord. I administrasjonen tillater det deg å opprette, blokkere og administrere brukere og opprette brukergrupper og tilgangsnivåer. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Users_User_Manager">Hjelp</a></p>\r\n<p>Vær oppmerksom på at enkelte av elementene ikke vil vises hvis du ikke er logget inn på nettstedet.</p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 23:15:55', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 5, '', '', 1, 29, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(53, 151, 'Bruke Joomla!', 'bruke-joomla', '', '<p>Med Joomla! kan du lage alt fra en enkel personlig nettside til en kompleks side med netthandel eller sosialt nettsted med millioner av besøkende.</p>\r\n<p>Denne delen av eksempeldata gir deg en kort innføring i Joomla! konseptet og referansematerialet for å hjelpe deg å forstå hvordan Joomla! fungerer.</p>\r\n<p><em>Når du ikke lenger trenger eksempeldata, trenger du bare avpublisere kategorien for eksempeldata som finnes i hver utvidelse i administrasjonen eller du kan slette alle elementene og alle kategoriene fullstendig. </em></p>', '', 1, 0, 0, 19, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 23:09:42', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 7, '', '', 1, 64, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(54, 152, 'Nettlenker', 'nettlenker', '', '<p>Nettlenker (com_weblinks) er en komponent som gir en strukturert måte å organisere eksterne lenker og presentere dem på en visuelt attraktiv, konsekvent og informativ måte. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Weblinks_Links">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:47:25', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 6, '', '', 1, 25, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(55, 153, 'Nettlenkemodul', 'nettlenkemodul', '', '<p>Denne modulen viser en liste over lenker i en kategori.  <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Weblinks" title="Modul Nettlenker">Hjelp</a></p>\r\n<p>{loadposition weblinksload}</p>', '', 1, 0, 0, 66, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:51:02', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 5, '', '', 1, 9, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(56, 154, 'Besøkende', 'besokende', '', '<p>Modulen Besøkende viser antall anonyme brukere (f. eks gjester) og registrerte brukere (de som er innlogget) som er på siden akkurat nå. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Who_Online" title="Besøkende">Hjelp</a></p>\r\n<p>{loadposition whosonlineload}</p>', '', 1, 0, 0, 65, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:51:28', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 18, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(57, 155, 'Wobbegone', 'wobbegone', '', '<p><img src="images/sampledata/parks/animals/180px_wobbegong.jpg" border="0" alt="Wobbegone" style="vertical-align: middle; border: 0;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/animals/800px_wobbegong.jpg" border="0" style="vertical-align: middle; border: 0;" /></p>\r\n<p>Kilde: http://en.wikipedia.org/wiki/File:Wobbegong.jpg</p>\r\n<p>Skribent: Richard Ling</p>\r\n<p>Rettigheter: GNU Free Documentation License v 1.2 or later</p>', 1, 0, 0, 72, '2011-01-01 00:00:01', 42, 'Nettredaktør parker', '2011-01-13 22:48:52', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(58, 156, 'Herlige vannmeloner', 'herlige-vannmeloner', '', '<p>Vannmelon er en fantastisk og sunn godbit. Vi dyrker verdens søteste vannmeloner. Vi har den største vannmelonåkeren i vårt land.</p>', '', 1, 0, 0, 30, '2011-01-01 00:00:01', 42, 'Nettredaktør fruktbutikk', '2011-01-13 22:13:56', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(59, 157, 'Modul for integrert ramme', 'modul-integrert-ramme', '', '<p>Denne modulen viser et vindu med integrert ramme til angitt sted. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Wrapper" title="Modulen Integrert ramme">Hjelp</a></p>\r\n<p>{loadposition wrapperload}</p>', '', 1, 0, 0, 67, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 22:01:06', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 1, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(60, 158, 'Nyhetsmatinger', 'nyhetsmatinger', '', '<p>Nyhetsmatinger (com_newsfeeds) gir en måte å organisere og presentere nyhetsmatinger. Nyhetsmating er en måte å presentere informasjon fra et annet område på ditt nettsted. For eksempel har nettsiden joomla.org mange matinger som du kan vise på nettstedet ditt. Du kan bruke menyene til å presentere en enkel mating, en liste med matinger i en kategori, eller en liste over alle matingskategorier. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Components_Newsfeeds_Feeds">Hjelp</a></p>', '', 1, 0, 0, 21, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 20:40:59', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 4, '', '', 1, 25, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(61, 159, 'Brødsmulemodulen', 'brodsmulemodulen', '', '<p>Brødsmuler viser sidesti for brukere for å kunne navigere seg igjennom nettstedet. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Breadcrumbs" title="Brødsmulemodulen">Hjelp</a></p>\r\n<p>{loadposition breadcrumbsload}</p>', '', 1, 0, 0, 75, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-15 21:46:27', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 2, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(62, 160, 'Innhold', 'innhold-content', '', '<p>Programtilleggene innhold kjører når spesifike type sider lastes. Disse gjør forskjellige ting fra å beskytte e-postadresser fra å bli fanget opp av bestemte søkemotorer til å lage sideskift i innholdet.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>E-postmaskering</li>\r\n<li>Laster moduler Hjelp</li>\r\n<li>Sideskift Hjelp</li>\r\n<li>Sidenavigering Hjelp</li>\r\n<li>Vurdering Hjelp</li>\r\n</ul>\r\n<p>Standard deaktivert:</p>\r\n<ul>\r\n<li>Uthever formatkoder (Geshi) Hjelp</li>\r\n</ul>', '', 1, 0, 0, 25, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 20:59:36', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 7, '', '', 1, 20, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(64, 162, 'Blue Mountain regnskog', 'blue-mountain-regnskog', '', '<p><img src="images/sampledata/parks/landscape/120px_rainforest_bluemountainsnsw.jpg" border="0" alt="Rain Forest Blue Mountrains" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/landscape/727px_rainforest_bluemountainsnsw.jpg" border="0" alt="Rain Forest Blue Mountrains" style="vertical-align: middle;" /></p>\r\n<p> </p>\r\n<p class="caption">Kilde: http://commons.wikimedia.org/wiki/File:Rainforest,bluemountainsNSW.jpg</p>\r\n<p class="caption">Skribent: Adam J.W.C.</p>\r\n<p class="caption">Lisens: GNU Free Documentation License</p>', 1, 0, 0, 73, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:43:53', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 2, '', '', 1, 11, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(65, 163, 'Ormiston Pound', 'ormiston-pound', '', '<p><img src="images/sampledata/parks/landscape/180px_ormiston_pound.jpg" border="0" alt="Ormiston Pound" style="border: 0;" /></p>\r\n', '\r\n<p><img src="images/sampledata/parks/landscape/800px_ormiston_pound.jpg" border="0" alt="Ormiston Pound" height="375" style="vertical-align: middle; border: 0;" /></p>\r\n<p> </p>\r\n<p class="caption">Kilde: http://commons.wikimedia.org/wiki/File:Ormiston_Pound.JPG</p>\r\n<p class="caption">Skribent:</p>\r\n<p class="caption">Lisens: GNU Free Public Documentation License</p>', 1, 0, 0, 73, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-13 22:44:47', 43, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 3, '', '', 1, 10, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(66, 165, 'Modul nyeste brukere', 'modul-nyeste-brukere', '', '<p>Denne modulen viser siste registrerte brukere. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Latest_Users">Hjelp</a></p>\r\n<p>{loadposition userslatestload}</p>', '', 1, 0, 0, 65, '2011-01-01 00:00:01', 42, 'Foreningen Joomla! i Norge', '2011-01-14 21:57:15', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"1","link_titles":"","show_intro":"","show_category":"1","link_category":"1","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 3, '', '', 1, 17, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(67, 168, 'Hva er nytt i 1.5?', 'hva-er-nytt-i-15', '', '<p>Som ved tidligere utgivelser, gir Joomla! en samlet og enkel struktur for å vise nettsider av alle typer. For å følge den tekniske utviklingen av Internett, krevdes det en vesentlig omorganisering av Joomla!-kjernens funksjonalitet og vi brukte denne muligheten til å forenkle mange av utfordringene som er i dagens brukergrensesnitt. Joomla! har mange nye trekk.</p>\r\n', '\r\n<p>Målet med utgivelse av Joomla! 1.5 er:</p>\r\n<ul>\r\n<li>\r\n<p>Betraktelig forbedret anvendelighet, påvirkelighet og målområdet langt utover den originale Mambo forankringen.</p>\r\n</li>\r\n<li>\r\n<p>Utvide tilgjengelighet for å støtte internasjonalisering, dobbeltbyte-tegn og høyre-til-venste støtte for språkene arabisk, farsi og hebraisk blant annet.</p>\r\n</li>\r\n<li>\r\n<p>Utvide integrasjonen med eksterne applikasjoner gjennom nettjenere og ekstern verifikasjon slik som Lightweight Directory Access Protocol (LDAP).</p>\r\n</li>\r\n<li>\r\n<p>Forsterket yteevne, nettstedsmaler og presentasjonsmuligheter for å støtte tilgjengelighetsstandarder og levere innhold til hvilket som helst bestemmelsessted.</p>\r\n</li>\r\n<li>\r\n<p>Oppnå mer utholdelig og fleksibel struktur for utviklere av komponenter og utvidelser.</p>\r\n</li>\r\n<li>\r\n<p>Være bakoverkompatibel med tidligere versjoner av komponenter, maler, moduler og andre utvidelser.</p>\r\n</li>\r\n</ul>', 2, 0, 0, 9, '2011-01-01 00:00:01', 42, 'Joomla! 1.5', '2011-01-15 23:17:52', 44, 0, '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 0, '', '', 1, 15, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(68, 170, 'Bekreftelsekode', 'bekreftelsekode', '', '<p>Programtillegg for bekreftelsekode brukes for å forhindre søppelinnsendinger/-registreringer i dine skjema som f.eks. registrerings-, kontakt- og innloggingsskjema. Din grunninstallasjon av Joomla inkluderer et programtillegg for bekreftelsekode som benytter tjenesten ReCaptcha®, men du kan også installere andre programtillegg for andre systemer for bekreftelsekode.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>ReCaptcha-<a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;amp;keyref=Help17:Extensions_Plugin_Manager_Edit">hjelp</a></li>\r\n</ul>\r\n<p>Merk: ReCaptcha er et registrert varemerke eid av Google Inc., og er et  selvstendig produkt som ikke er assosiert med, eller støttet av Joomla-prosjektet. Du må registrere deg, samt akseptere betingelsen, på Recaptcha.net – for å kunne bruke dette programtillegget. Utfyllende instruksjoner er tilgjengelig om du redigerer programtillegget for ReCaptcha under \'Utvidelser - Programtillegg\' i administrasjonen.</p>', '', 1, 0, 0, 25, '2012-01-17 03:20:45', 42, 'Joomla!', '2012-01-17 03:35:46', 42, 0, '0000-00-00 00:00:00', '2012-01-17 03:20:45', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":"","urlatext":"","targeta":"","urlb":"","urlbtext":"","targetb":"","urlc":"","urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 1, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(69, 171, 'Hurtigknapper', 'hurtigknapper', '', '<p>Programtilleggruppen hurtigknapper brukes for å vise varsler om oppdateringer for Joomla eller utvidelser, som man bør oppdatere til. Disse varslene vises i adminsitrasjonens kontrollpanel, som er den første siden du ser etter å ha logget på nettstedets administrasjon.</p>\r\n<p>Standard aktivert:</p>\r\n<ul>\r\n<li>Hurtigknapp - Oppdateringsvarsel for Joomla-utvidelser - <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;amp;keyref=Help17:Extensions_Plugin_Manager_Edit">Hjelp</a>.</li>\r\n<li>Hurtigknapp - Oppdateringsvarsel for Joomla! - <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;amp;keyref=Help17:Extensions_Plugin_Manager_Edit">Hjelp</a></li>\r\n</ul>', '', 1, 0, 0, 25, '2012-01-17 03:27:39', 42, 'Joomla!', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-01-17 03:27:39', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":"","urlatext":"","targeta":"","urlb":"","urlbtext":"","targetb":"","urlc":"","urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 0, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(70, 170, 'Smartsøk', 'smartsok', '', '<p>Denne modulen tilbyr søk ved bruk av \'Smartsøk\'-komponenten. Du bør bare bruke den om du har indeksert ditt innhold, samt at du har aktivert programtillegget \'Innhold - Smartsøk\', eller manuelt holder din sides indeks oppdatert. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;amp;keyref=Help25:Extensions_Module_Manager_Smart_Search">Hjelp</a>.</p>\r\n<div class="sample-module">{loadmodule finder,Smart Search}</div>', '', 1, 0, 0, 67, '2012-01-17 03:42:36', 42, '', '2012-01-17 16:15:48', 42, 0, '0000-00-00 00:00:00', '2012-01-17 03:42:36', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":"","urlatext":"","targeta":"","urlb":"","urlbtext":"","targetb":"","urlc":"","urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 10, 0, 0, '', '', 1, 13, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
