(7, 31, 0, 'Baw Baw Nasjonalpark', 'baw-baw-nasjonalpark', 'http://www.parkweb.vic.gov.au/1park_display.cfm?park=44', '<p>Park i Australske Alpers Nasjonalparker, Baw Baw tilbyr sub alpevegetasjon, vakker utsikt, og muligheter for fotturer, skiturer og andre utendørs aktiviteter.</p>', '0000-00-00 00:00:00', 1, 1, 0, '0000-00-00 00:00:00', 1, 0, 1, 1, '{"target":"0","width":"","height":"","count_clicks":""}', 'nb-NO', '2011-01-01 00:00:01', 0, '', '2011-01-14 23:32:25', 44, '', '', '{"robots":"","author":"","rights":""}', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, 31, 0, 'Kakadu', 'kakadu', 'http://www.environment.gov.au/parks/kakadu/index.html', '<p>Kakadu er kjent for både sin kulturelle arv og dens naturlige skjønnhet. Og er av begge grunnene oppført som bevaringsverdig, som en av få steder. Omfattende bergkunst finnes der.</p>', '0000-00-00 00:00:00', 1, 1, 0, '0000-00-00 00:00:00', 2, 0, 1, 1, '{"target":"0","width":"","height":"","count_clicks":""}', 'nb-NO', '2011-01-01 00:00:01', 0, 'Foreningen Joomla! i Norge', '2011-01-14 23:42:26', 44, '', '', '{"robots":"","author":"","rights":""}', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(9, 31, 0, 'Pulu Keeling', 'pulu-keeling', 'http://www.environment.gov.au/parks/cocos/index.html', '<p>Ligger på en atoll 2000 kilometer nord for Perth, Pulu Keeling er Australias minste nasjonalpark.</p>', '0000-00-00 00:00:00', 1, 1, 0, '0000-00-00 00:00:00', 3, 0, 1, 1, '{"target":"0","width":"","height":"","count_clicks":""}', 'nb-NO', '2011-01-01 00:00:01', 0, 'Foreningen Joomla! i Norge', '2011-01-14 23:51:57', 44, '', '', '{"robots":"","author":"","rights":""}', 0, '', '2010-07-10 23:44:03', '0000-00-00 00:00:00'),
(10, 32, 0, 'Joomla! i Norge', 'joomla-i-norge', 'http://www.joomlainorge.no/', '<p>Foreningen arbeider for å utbre bruken av publiseringsløsningen Joomla!,  og bidrar til dette ved å oversette til norsk, samt dokumentere bruk av  denne løsningen.</p>', '0000-00-00 00:00:00', 1, 1, 0, '0000-00-00 00:00:00', 4, 0, 1, 1, '{"target":"","width":"","height":"","count_clicks":""}', '*', '2011-01-14 23:55:02', 44, 'Foreningen Joomla! i Norge', '0000-00-00 00:00:00', 0, '', '', '', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(11, 32, 0, 'Joomla! brukere i Norge', 'joomla-brukere-i-norge', 'http://brukere.joomlainorge.no/', '<p>brukere.joomlainorge.no er ei sosial side for norske brukere av Joomla!.   På denne sida kan alle som bruker Joomla! treffes og diskutere,   engasjere seg og samarbeide.</p>', '0000-00-00 00:00:00', 1, 1, 0, '0000-00-00 00:00:00', 5, 0, 1, 1, '{"target":"","width":"","height":"","count_clicks":""}', '*', '2011-01-14 23:58:08', 44, 'Foreningen Joomla! i Norge', '0000-00-00 00:00:00', 0, '', '', '', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
